import X6Events from './events';
const svgNS = "http://www.w3.org/2000/svg";
const toolbarConfig = [
    {
        "label": "放大",
        "file": "data:image/png;base64,",
        "key": "fangda"
    },
    {
        "label": "缩小",
        "file": "data:image/png;base64,",
        "key": "suoxiao"
    },
    {
        "label": "撤销",
        "file": "data:image/png;base64,",
        "key": "chexiao"
    },
    {
        "label": "恢复",
        "file": "data:image/png;base64,",
        "key": "huifu",
    },
    {
        "label": "导出",
        "file": "data:image/png;base64,",
        "key": "export",
        children: [
            {
                "label": "导出svg",
                "key": "export-svg"
            },
            {
                "label": "导出png",
                "key": "export-png"
            },
            {
                "label": "导出jpeg",
                "key": "export-jpeg"
            },
        ]
    },
];
export default class ToolBar extends X6Events {
    constructor(graph, container) {
        super(graph, container);
        this._createToolVarElement();
    }
    _createToolVarElement() {
        const el = document.querySelector('.containerBox');
        const container = document.createElement('div');
        container.className = 'toolbarContainer';
        el.appendChild(container);
        toolbarConfig.forEach(item => {
            const box = document.createElement('div');
            box.className = 'toolBox';
            const image = document.createElement('img');
            image.src = item.file;
            image.alt = item.label;
            image.setAttribute('key', item.key);
            box.appendChild(image);
            const tips = document.createElement('span');
            tips.innerText = item.label;
            box.appendChild(tips);
            if (item.children && item.children.length) {
                const menu = document.createElement('ul');
                menu.className = 'toolMenu';
                item.children.forEach(child => {
                    const li = document.createElement('li');
                    li.innerText = child.label;
                    li.setAttribute('key', child.key);
                    menu.appendChild(li);
                });
                box.appendChild(menu);
            }
            container.appendChild(box);
        });
        container.addEventListener('click', (ev) => {
            this._toolHandler(ev);
        });
    }
    _toolHandler(ev) {
        const target = ev.target;
        if (target) {
            const key = target.getAttribute('key');
            if (key) {
                switch (key) {
                    case 'fangda':
                        this.upZoom();
                        break;
                    case 'suoxiao':
                        this.downZoom();
                        break;
                    case 'chexiao':
                        this.undo();
                        break;
                    case 'huifu':
                        this.redo();
                        break;
                    case 'export-svg':
                        this.exportSVG();
                        break;
                    case 'export-png':
                        this.exportPNG();
                        break;
                    case 'export-jpeg':
                        this.exportJPEG();
                        break;
                    default:
                        break;
                }
            }
        }
    }
}
